function toc(){var e=document.getElementById("_instructions"),t=["H1","H2","H3","H4","H5","H6"],l=e.querySelectorAll(t),n="<ul>",r="";l.forEach(e=>{r=t.indexOf(e.tagName);for(let e=0;e<r;e++)n+="<ul>";n+='<li><a class="hyperlink text-muted" href="#'+e.innerText.toLowerCase().replace(/\s/g,"-").replace("/","").replace(")","")+'">'+e.innerText+"</li>";for(let e=0;e<r;e++)n+="</ul>"}),n+="</ul>",document.getElementById("toc").innerHTML=n}